import React from 'react';
import { Link } from 'react-router-dom';

// import { Button as button, Nav as nav } from 'react-bootstrap';

const Header = () => {
    return (
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container">
          <ul>
            <li>
        <Link className="active nav-item" aria-current="page" to="/home">Home</Link>
        </li>
        <Link className="nav-item" to="/checkout">Checkout</Link>
        <li></li>
        <Link className="nav-item" to="/admin">Admin</Link>
        <Link className="nav-item" to="/deals">Deals</Link>
        <Link className="nav-link btn btn-outline-success" to="/login">Login</Link>
        </ul> 
        <form className="d-flex"> 
         <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"></input>
         <button className="btn btn-outline-success" type="submit">Search</button>
        </form>
        </div>
      </nav>
        
    );
};

export default Header;
